import { useState, useEffect } from "react";
import "./Login.css";
import { getUserProfile } from "../../redux/actions";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { GoogleLogin } from "react-google-login";
import { gapi } from "gapi-script";

const Login = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [login, setLogin] = useState({ nameUser: "", password: "" });

  // Inicializar gapi autenticación con Google
  useEffect(() => {
    const initClient = () => {
      gapi.client.init({
        clientId:
          "133661170359-fkebjnpt8sudfqujbcjbjrtj1cc8veoc.apps.googleusercontent.com", // Reemplaza por tu clientId
        scope: "email",
      });
    };
    gapi.load("client:auth2", initClient);
  }, []);

  const onChangeHandler = (event) => {
    const property = event.target.name;
    const value = event.target.value;
    setLogin({ ...login, [property]: value });
  };

  const onSubmitHandler = async (event) => {
    try {
      event.preventDefault();
      const authenticated = await dispatch(getUserProfile(login));
      if (authenticated) {
        navigate("/userProfile");
      }
    } catch (error) {
      alert(error);
    }
  };

  const onSuccessGoogle = async (response) => {
    const userInfo = response.profileObj;

    try {
      const authenticated = await dispatch(
        getUserProfile({ email: userInfo.email })
      );
      if (authenticated) {
        navigate("/userProfile");
      } else {
        alert("Error en el inicio de sesión");
      }
    } catch (error) {
      console.error("Error al iniciar sesión con Google:", error);
      alert("Error en el inicio de sesión");
    }
  };

  return (
    <div>
      <div>
        <body>
          <div class="container" id="container">
            <div class="form-container sign-up">
              <form>
                <h1>Create Account</h1>
                <div class="social-icons">
                  <a href="#" class="icon">
                    <i class="fa-brands fa-google-plus-g"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-facebook-f"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-github"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-linkedin-in"></i>
                  </a>
                </div>
                <span>or use your email for registeration</span>
                <input type="text" placeholder="Name" />
                <input type="email" placeholder="Email" />
                <input type="password" placeholder="Password" />
                <button>Sign Up</button>
              </form>
            </div>

            <div class="form-container sign-in">
              <form>
                <h1>Sign In</h1>
                <div class="social-icons">
                  <a href="#" class="icon">
                    <i class="fa-brands fa-google-plus-g"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-facebook-f"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-github"></i>
                  </a>
                  <a href="#" class="icon">
                    <i class="fa-brands fa-linkedin-in"></i>
                  </a>
                </div>
                <span>or use your email password</span>
                <input type="email" placeholder="hola" />
                <input type="password" placeholder="Password" />
                <a href="#">Forget Your Password?</a>
                <button>Sign In</button>
              </form>
            </div>

            <div class="toggle-container">
              <div class="toggle">
                <div class="toggle-panel toggle-left">
                  <h1>Welcome Back!</h1>
                  <p>Enter your personal details to use all of site features</p>
                  <button class="hidden" id="login">
                    Sign In
                  </button>
                </div>
                <div class="toggle-panel toggle-right">
                  <h1>Hello, Friend!</h1>
                  <p>
                    Register with your personal details to use all of site
                    features
                  </p>
                  <button class="hidden" id="register">
                    Sign Up
                  </button>
                </div>
              </div>
            </div>
          </div>

          <script src="script.js"></script>
        </body>
      </div>
      {/* <form onSubmit={onSubmitHandler}>
        <div>
          <label>User</label>
          <input
            type="text"
            value={login.nameUser}
            name="nameUser"
            onChange={onChangeHandler}
          />
          <label>Password</label>
          <input
            type="password"
            value={login.password}
            name="password"
            onChange={onChangeHandler}
          />
          <button type="submit">Login</button>
        </div>
      </form> */}
      {/* 
      <div>
        <p>O inicia sesión con Google:</p>
        <GoogleLogin
          clientId="133661170359-fkebjnpt8sudfqujbcjbjrtj1cc8veoc.apps.googleusercontent.com" // Reemplaza con tu ID de cliente
          buttonText="Login with Google"
          onSuccess={onSuccessGoogle}
          cookiePolicy={"single_host_origin"}
        />
      </div> */}
    </div>
  );
};

export default Login;
